import React from 'react';
import {BrowserRouter as Router, Route, Switch} from 'react-router-dom'
import Page404 from "../pages/Page404";

function Routes(props) {
    return (
        <Router>
            <Switch>
                <Route path='*'><Page404/></Route>
            </Switch>
        </Router>
    );
}

export default Routes;
